    /**Return value for values x and y (x, y)
     * 
     * have $x and $y and trying to find $z
     * 
     * @param integer $x
     * @param string $y (key: reverse hex)
     * @return boolean||string ($z returned character)
     */
    public static function get_character($x = '', $y = '') {
        if (!has_presence($x) || !has_presence($y)) {
            return false;
        } else {
            $sql  = "SELECT * FROM " . self::$table_name . " ";
            $sql .= "WHERE col_letter = '{$x}' ";
            $sql .= "LIMIT 1";
            $result = self::find_by_sql($sql);
            $rows = ($result) ? array_shift($result) : false;
            $field = "l".$y;
            if ($rows) {
                foreach ($rows as $key=>$col) {
                    if ($key == $field) {
                         return hexdec(strrev($rows->$field));
                    }
                }
                return false;
            }
            
//            return "(x):" . chr($x) . " (y):" . chr(substr($key, 1, strlen($key))) . " (z):" . chr(hexdec(strrev($col))) . "<br>";
                 
        }
    }
    
    /**
     * $x must be a letter not an ascii code
     * 
     * Have $x and $z and trying to find $y
     * 
     * Randomly choose which $x to use and then returning $y 
     * @param string $x
     * @param string $letter
     * @return boolean||string xy (x, y)
     */
    public static function generate_code($x='', $letter='') {
        if (!has_presence($letter) || !has_presence($letter)) {
            return false;
        }
        $sql  = "SELECT * FROM " . self::$table_name . " ";
        $sql .= "WHERE col_letter = '{$x}' ";
        $sql .= "LIMIT 1";
        $result = self::find_by_sql($sql);
        if ($result) {
            $row = array_shift($result);
        } else {
            return false;
        }
        foreach ($row as $key=>$value) {
            if (hexdec(strrev($value)) === ord($letter)) {
                return chr((int)substr($key, 1, strlen($key)));
            }
        }
        return false;
    }
    
    public static function convert_character_to_word($char) {
        $string = "";
        switch ($char) {
            case "!":
                $string = "bang";
                break;
            case "@":
                $string = "at";
                break;
            case "#":
                $string = "num";
                break;
            case "$":
                $string = "dollar";
                break;
            case "%":
                $string = "percent";
                break;
            case "^":
                $string = "karat";
                break;
            case "&":
                $string = "amper";
                break;
            case "*":
                $string = "asterisk";
                break;
            case "(":
                $string = "oparenth";
                break;
            case ")":
                $string = "cparenth";
                break;
            case "[":
                $string = "obracket";
                break;
            case "]":
                $string = "cbracket";
                break;
            case ",":
                $string = "comma";
                break;
            case ".":
                $string = "period";
                break;
            case ";":
                $string = "semicolon";
                break;
            case ":":
                $string = "colon";
                break;
            case "<":
                $string = "lessthan";
                break;
            case ">":
                $string = "greaterthan";
                break;
            case "?":
                $string = "question";
                break;
            case "/":
                $string = "slash";
                break;
            case "\\":
                $string = "backslash";
                break;
            case "-":
                $string = "dash";
                break;
            case "=":
                $string = "equal";
                break;
            case "0":
                $string = "zero";
                break;
            case "1":
                $string = "one";
                break;
            case "2":
                $string = "two";
                break;
            case "3":
                $string = "three";
                break;
            case "4":
                $string = "four";
                break;
            case "5":
                $string = "five";
                break;
            case "6":
                $string = "six";
                break;
            case "7":
                $string = "seven";
                break;
            case "8":
                $string = "eight";
                break;
            case "9":
                $string = "nine";
                break;
                
            default :
                $string = $char;
                break;
        }
        return $string;
    }
    
    public static function generate_table_and_data() {
        global $base;
        $obj = new self;
        $text = "";
        if ($obj->create_table()) {
            $text .= "Table " . self::$table_name . " created";
            $sql = "SELECT COUNT(*) FROM " . self::$table_name;
            $results = $base->query($sql);
            $row = $base->fetch_array($results);
            $num = array_shift($row);
            if ($num <= 0) {
                if ($obj->load_data()) {
                    $text .= " and populated!";
                }
            } else {
                $text .= "!";
            }
            return $text;
        }
    }
    
